import React from 'react'
import {Link} from 'react-router-dom'

const Header = () => {
    return(
        <nav class="navbar navbar-expand-lg navbar-dark bg-dark fixed-top">
            <div class="container">
                <Link class="navbar-brand" to="/">Dream Search</Link>
            </div>
        </nav>
    )
}

export default Header;
